import React, { useRef, useState } from 'react';
import MovingObject2 from './MovingObject2';

const MovingObjectsContainer = ({ n }) => {
  const [yValues, setYValues] = useState(new Array(n).fill(0));

  const handleYChange = (index, value) => {
    const newValues = [...yValues];
    newValues[index] = value;
    setYValues(newValues);
  };

  return (
    <div>
      {Array.from({ length: n }, (_, i) => (
        <div key={i}>
          <input
            type="number"
            value={yValues[i]}
            onChange={(e) => handleYChange(i, parseInt(e.target.value))}
          />
          <MovingObject y={yValues[i]} />
        </div>
      ))}
    </div>
  );
};
export default MovingObjectsContainer;
